import React from 'react';
import Link from 'react-router-dom'

const Header = () => {
    return (
        <ul>
            <li><Link to='/login'>로그인</Link></li>
            <li><Link to='/join'>회원가입</Link></li>
        </ul>
    );
};

export default Header;
